import React from "react";
import Heading from "./Heading";
import Greeting from "./Greeting";
import Calculation from "./Calculation";
import ImagesComp from "./ImagesComp";
import Cards from "./Cards";
import Sdata from "./Sdate";

const imgSrc = Sdata[0].imgSrc;
const cardCategory = Sdata[0].cardCategory;
const seriesname = Sdata[0].seriesname;
const hrefLink = Sdata[0].hrefLink;

function App() {
  return (
    <>
      <Heading />
      <Greeting></Greeting>
      <ImagesComp></ImagesComp>
      <Calculation></Calculation>
      <div className="AllCards">
        <Cards
          imgSrc="https://wallpapercave.com/wp/wp4056410.jpg"
          cardCategory="A Netflix original Series"
          seriesname="Dark"
          hrefLink="https://www.netflix.com/in/title/80990668?source=35"
        />
        <Cards
          imgSrc="https://wallpapercave.com/wp/wp11755845.jpg"
          cardCategory="A Netflix original Series"
          seriesname="Wednesday"
          hrefLink="https://www.netflix.com/search?q=wednesday"
        />
        <Cards
          imgSrc="https://wallpapers.com/images/high/cute-stranger-things-logo-in-black-up9ex91klrbnl4sf.webp"
          cardCategory="A Netflix original Series"
          seriesname="Stranger things"
          hrefLink="https://www.netflix.com/watch/80235274?trackId=255824129"
        />
        {/* <Cards sdata={Sdata} /> */}
      </div>
    </>
  );
}

export default App;
